import React from "react";


type TypeModalEndProps = {
    winner: string | null;
}


const ModalEnd: React.FC <TypeModalEndProps> = ({winner}) => {

    const resultWinner = (w: string | null): string => {
        if(winner === "x") {
            return "X"
        } else if (winner === "o") {
            return "O"
        }
        return "Ничья"
    }
    const win = resultWinner(winner)


    return(
        <div className="container_modalEnd">
            {win}
        </div>
    )
}

export default ModalEnd;
